import './Option.css';
import collage from './images/collage.jpeg'
function Option(){
    return (
        <div className='options'>
            <div className='collage-logo'>
                <img src={collage}></img>
                <a href="http://google.com">Collage</a>
            </div>
            <div className='staged-logo'>
                <img src={collage}></img>
                <a href="http://google.com">Staged Scrolling</a>
            </div>
            <div className='carousel-logo'>
                <img src={collage}></img>
                <a href="http://google.com">Carousel</a>
            </div>
        </div>
    );
}

export default Option;
